import React from 'react';
import './styles.scss';

function RSVP() {
  return (
    <div className="rsvp-wrapper">
      <div className="no-wrapper half">
        <span className="no">
          <img src="url(../../assets/no.gif" />
          No :/
        </span>
      </div>

      <div className="go-wrapper half">
        <span className="go">
          <img src="url(../../assets/go.gif)" />
          Go :}
        </span>
      </div>
    </div>
  );
}

export default RSVP;
